return new Promise((resolve, reject) => {

    let invitenum = 0
    const code = ['邀请码1', '邀请码2', '邀请码3'];
    const BASE_KEY = CryptoJS.enc.Base64.parse('tJb4MRKOT+HeM/S3osRuDdR3JSSkgm/kSG/MB+PiuH8=');

    class Ant {
        constructor(aff) {
            this.aff = aff;
            this.oauth_id = '';
            this.timestamp = '';
            this.url = 'http://antapi3.ymjxopa.com/api.php';
        }

        static getTimestamp(long = 10) {
            return Date.now().toString().slice(0, long);
        }

        decrypt(data) {
            const ctIv = CryptoJS.enc.Hex.parse(data.substr(0, 32));
            const ctBytes = CryptoJS.enc.Hex.parse(data.substr(32));
            const cipher = CryptoJS.AES.decrypt(
                { ciphertext: ctBytes },
                BASE_KEY,
                { iv: ctIv, mode: CryptoJS.mode.CFB, padding: CryptoJS.pad.NoPadding }
            );
            return cipher.toString(CryptoJS.enc.Utf8);
        }

        encrypt(data) {
            const iv = CryptoJS.lib.WordArray.random(16);
            const cipher = CryptoJS.AES.encrypt(
                data,
                BASE_KEY,
                { iv: iv, mode: CryptoJS.mode.CFB, padding: CryptoJS.pad.NoPadding }
            );
            return iv.concat(cipher.ciphertext).toString().toUpperCase();
        }

        getSign() {
            const template = `appId=android&appVersion=2.1.8&data=${this.encryptData}&timestamp=${this.timestamp}2d5f22520633cfd5c44bacc1634a93f2`;
            const sha256Hash = CryptoJS.SHA256(template).toString();
            return CryptoJS.MD5(sha256Hash).toString();
        }

        request(d) {
            return new Promise((resolve) => {
                const plaintext = {
                    version: "2.6.5",
                    app_type: "ss_proxy",
                    language: 0,
                    bundleId: "com.android.tnaant"
                };
                Object.assign(d, plaintext);
                this.timestamp = Ant.getTimestamp(10);
                this.encryptData = this.encrypt(JSON.stringify(d));
                const sign = this.getSign();

                GM_xmlhttpRequest({
                    method: "POST",
                    url: this.url,
                    data: `appId=android&appVersion=2.1.8&timestamp=${this.timestamp}&data=${this.encryptData}&sign=${sign}`,
                    headers: {
                        "Content-Type": "application/x-www-form-urlencoded"
                    },
                    onload: (response) => {
                        const resData = JSON.parse(response.responseText);
                        const decrypted = this.decrypt(resData.data);
                        resolve(decrypted);
                    }
                });
            });
        }

        async getUser() {
            const oauth_id = CryptoJS.lib.WordArray.random(16).toString();
            const data = {
                oauth_id: oauth_id,
                oauth_type: "android",
                mod: "user",
                code: "up_sign"
            };
            await this.request(data);
            this.oauth_id = oauth_id;
        }

        async invite() {
            await this.getUser();
            const data = {
                oauth_id: this.oauth_id,
                oauth_type: "android",
                aff: this.aff,
                mod: "user",
                code: "exchangeAFF"
            };
            const datalog = await this.request(data);
            invitenum++
            GM_log(datalog);
        }
    }

    (async function main() {
        for (const i of code) {
            const ant = new Ant(i);
            await ant.invite();
            if (invitenum >= code.length) {
                resolve();
            };
        }
    })();
});
